@app.route('/hpu1/get')
def hpu1_get():

    file_name = os.path.dirname(os.path.realpath(__file__)) + "/"+HPU1_COUNT_FILE
    with open(file_name, 'r+') as file:

        count = file.read()

        if int(count) < IMAGE_COUNT:

            new_count = str(int(count) + 1)
            file.seek(0)
            file.truncate()
            file.write(new_count)

            response = prepend + image_file_name[int(count)]

        else:
            response = prepend + "done.png"

        return response


